import React, { Component } from "react";
import Navbar from "./Navbar";

class Add extends Component {
  constructor(props) {
    super(props);

    this.state = {
      title: "",
      city: "",
      location: "",
      price: "",
      buy: "",
      bedroom: "",
      bathroom: "",
      area: "",
    };
  }
  handletitleChange = (event) => {
    this.setState({
      title: event.target.value,
    });
  };
  handlecityChange = (event) => {
    this.setState({
      city: event.target.value,
    });
  };

  handlelocatioChange = (event) => {
    this.setState({
      location: event.target.value,
    });
  };

  handlepriceChange = (event) => {
    this.setState({
      price: event.target.value,
    });
  };

  handlebuyChange = (event) => {
    this.setState({
      buy: event.target.value,
    });
  };

  handlebedroomChange = (event) => {
    this.setState({
      bedroom: event.target.value,
    });
  };
  handlebathroomChange = (event) => {
    this.setState({
      bathroom: event.target.value,
    });
  };
  handleareaChange = (event) => {
    this.setState({
      area: event.target.value,
    });
  };

  handleSubmit = (event) => {
    alert(
      "${this.state.title} ${this.state.city} ${this.state.location} ${this.state.price} ${this.state.buy} ${this.state.bedroom} ${this.state.bathroom} ${this.state.area}"
    );
    event.preventDefault();
  };

  render() {
    return (
      <div className="container">
        <div className="agentlogin">
          <h3> Add the details </h3>{" "}
          <form onSubmit={this.handleSubmit}>
            <div className="wrapper">
              <div>
                <label> Title </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.title}
                  onChange={this.handletitle}
                />
              </div>{" "}
              <div>
                <label> City </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.city}
                  onChange={this.handlecity}
                />
              </div>{" "}
              <div>
                <label> Location </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.location}
                  onChange={this.handlelocation}
                />
              </div>{" "}
              <div>
                <label> Price </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.price}
                  onChange={this.handleprice}
                />{" "}
              </div>{" "}
              <div>
                <label> Buy / Rent </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.buy}
                  onChange={this.handlebuy}
                />{" "}
              </div>{" "}
              <div>
                <label> Bedroom </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.bedroom}
                  onChange={this.handlebedroom}
                />{" "}
              </div>{" "}
              <div>
                <label> Bathroom </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.bathroom}
                  onChange={this.handlebathroom}
                />{" "}
              </div>{" "}
              <div>
                <label> Area </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.area}
                  onChange={this.handlearea}
                />{" "}
              </div>{" "}
              <button type="submit"> Submit </button>{" "}
            </div>{" "}
          </form>
        </div>{" "}
      </div>
    );
  }
}

export default Add;
